import React, { useState } from 'react';

function Transactions({ operations }) {
  const [filter, setFilter] = useState('all');
  const [sortBy, setSortBy] = useState('date');
  const [sortOrder, setSortOrder] = useState('desc');

  const filteredOperations = operations.filter(op => {
    if (filter === 'all') return true;
    return op.type === filter;
  });

  const sortedOperations = [...filteredOperations].sort((a, b) => {
    if (sortBy === 'date') {
      return sortOrder === 'desc' 
        ? new Date(b.date) - new Date(a.date)
        : new Date(a.date) - new Date(b.date);
    }
    if (sortBy === 'amount') {
      return sortOrder === 'desc'
        ? b.amount - a.amount
        : a.amount - b.amount;
    }
    return 0;
  });

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString('ru-RU', {
      day: '2-digit',
      month: '2-digit',
      year: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  return (
    <div className="transactions-page">
      <h1>Список транзакций</h1>

      <div className="filters">
        <div className="filter-group">
          <label>Фильтр:</label>
          <select value={filter} onChange={(e) => setFilter(e.target.value)}>
            <option value="all">Все</option>
            <option value="income">Доходы</option>
            <option value="expense">Расходы</option>
          </select>
        </div>

        <div className="filter-group">
          <label>Сортировка:</label>
          <select value={sortBy} onChange={(e) => setSortBy(e.target.value)}>
            <option value="date">По дате</option>
            <option value="amount">По сумме</option>
          </select>
        </div>

        <div className="filter-group">
          <label>Порядок:</label>
          <select value={sortOrder} onChange={(e) => setSortOrder(e.target.value)}>
            <option value="desc">По убыванию</option>
            <option value="asc">По возрастанию</option>
          </select>
        </div>
      </div>

      <div className="transactions-list">
        {sortedOperations.length === 0 ? (
          <p className="no-data">Нет транзакций</p>
        ) : (
          sortedOperations.map(operation => (
            <div key={operation.id} className={`transaction-item ${operation.type}`}>
              <div className="transaction-date">{formatDate(operation.date)}</div>
              <div className="transaction-type">
                {operation.type === 'income' ? 'Доход' : 'Расход'}
              </div>
              <div className="transaction-amount">
                {operation.type === 'income' ? '+' : '-'}{operation.amount} ₽
              </div>
              {operation.category && (
                <div className="transaction-category">
                  <span className="category-label">Категория:</span>
                  <span className="category-value">{operation.category}</span>
                </div>
              )}
            </div>
          ))
        )}
      </div>
    </div>
  );
}

export default Transactions;
